import React, { useState }from 'react';
import callApi from '.'

export default function data() {
  const [data, setData] = useState();

  useEffect(() => {
    async function fetchData() {
      await callApi("get", "products", null)
        .then((res) => setData(res.data))
        .catch((err) => console.log(err));
    }
    fetchData();
  }, []);
  return (
    <div>

    </div>
  )
}
